import React from 'react';
import { gql, graphql } from '@apollo/client';

const getBooksQuery = gql`
    {
        books {
            name
            id
        }
    }
`

const BookList = () => {
    return (
      <div>
        <ul id="book-list">
            <li>Book name</li>
        </ul>
      </div>
    );
}

export default graphql(getBooksQuery)(BookList);
